    def gen_combinations(n: int, k: int) -> Iterator[tuple[int,...]]:
        """
        Подбор пар решеток
        """
        idx = list(range(1, k + 1))
        if k <= n:
            yield tuple(idx)
            for i in range(1, k):
                for comb in gen_combinations(n, i + 1):
                    yield comb + (i,)
        else:
            for comb in gen_combinations(n, k):
                yield comb

    def gen_roads(n: int, k: int, x: int) -> Iterator[tuple[int,...]]:
        """
        Подбор решеток
        """
        for comb in gen_combinations(k, 2):
            yield (x, *comb)

    def gen_groups(n: int, x: int) -> Iterator[tuple[int,...]]:
        """
        Подбор групп
        """
        for i in range(1, n + 1):
            yield (x, i)

    def check(comb: tuple[int,...], group: tuple[int,...]) -> bool:
        """
        Проверка комбинации
        """
        for x, y in combinations(comb, 2):
            if x not in group and y not in group:
                return False
        return True

    def solve(n: int, a: list[int]) -> Iterator[tuple[int,...]]:
