        return "NO"
    segment = [sum(nums[:i]) for i in range(1, len(nums) + 1)]
    segment.sort()
    start = 0
    for i in range(k):
        if odd >= k:
            break
        subsegment = segment[start:]
        if sum(subsegment) % 2 == 0:
            start += 1
        else:
            odd += 1
    if odd >= k:
        return "YES"
    return "NO"

