            for i, j in diag_queen_positions[row - col]:
                solution = set(
                    [
                        (i, j),
                        (i, col),
                        (row, j),
                        (row, col),
                        (i, row - col),
                        (i, row + col),
                        (row - col, j),
                        (row + col, j),
                    ]
